import React from 'react';
import { Routes, Route, Navigate, useLocation } from 'react-router-dom';
import UsersList from '../components/UsersList';
import CreateUserForm from '../components/CreateUserForm';
import EditUserForm from '../components/EditUserForm';
import TestRoutes from '../components/TestRoutes';

const UsersPage = () => {
  const location = useLocation();
  console.log('üìç UsersPage - Ruta actual:', location.pathname);

  return (
    <div className="p-6">
      {/* Componente de prueba temporal */}
      {process.env.NODE_ENV === 'development' && (
        <div className="mb-6">
          <TestRoutes />
        </div>
      )}
      
      <Routes>
        {/* Lista de usuarios - ruta principal */}
        <Route path="/" element={<UsersList />} />
        
        {/* Crear nuevo usuario */}
        <Route path="crear" element={
          <div>
            <div className="mb-6">
              <h1 className="text-2xl font-bold text-gray-900">Crear Usuario</h1>
              <p className="text-gray-600">Agrega un nuevo usuario al sistema</p>
            </div>
            <CreateUserForm />
          </div>
        } />
        
        {/* Editar usuario existente */}
        <Route path="editar/:id" element={
          <div>
            <div className="mb-6">
              <h1 className="text-2xl font-bold text-gray-900">Editar Usuario</h1>
              <p className="text-gray-600">Modifica la informaci√≥n del usuario</p>
            </div>
            <EditUserForm />
          </div>
        } />
        
        {/* Redirecci√≥n por defecto */}
        <Route path="*" element={<Navigate to="/usuarios" replace />} />
      </Routes>
    </div>
  );
};

export default UsersPage;
